INSERT INTO `sv_announcements` VALUES (3, 'Ucapan Terima Kasih', '<p>hi All super team MBI</p>\n\n<p>Kami management MBI mengucapkan terima kasih kepada semua team yang sudah membantu mengisi KKM atau CRM dengan baik, ini sangat berharga untuk organisasi MBI&nbsp;dalam meningkatkan kwalitas team kita dan sangat mendukung dalam program menuju MBI 4.0 untuk kemudahan dalam mengakses big data sehingga keputusan keputusan akan lebih cepat dan tepat (<strong>Excellent Service</strong>).</p>\n\n<p>&nbsp;</p>\n\n<p>Salam</p>\n\n<p>Management MBI</p>\n', 'divisi', '13', NULL, NULL, 'NonAktif', '270611', '2019-05-28 06:44:41', '270611', '2019-06-16 00:00:00');
