INSERT INTO `sv_announcements` VALUES (7, 'Pelajaran 1 : Tahapan Penjualan (STAGE) ', '<p><u><strong>Tahapan penjualan&nbsp;(STAGE)&nbsp;adalah sebagi berikut</strong></u></p>\n\n<p>1. Perkenalan <em>( MBI mempunyai produk yang dibutuhkan customer)</em></p>\n\n<p>2. Visit, presentasi <em>( meyakinkan spek masuk)</em></p>\n\n<p>3. Penawaran <em>(setelah spek masuk dibuatkan penawaran)</em></p>\n\n<p>4. Budget + estimasi PO <em>(tanyakan apakah ada budget yang cukup dan estimasi eksekusinya kapan)</em></p>\n\n<p>5. Kompetitor + kecenderungan <em>(brapa presentase milih produk MBI ?)</em></p>\n\n<p>6. Menunggu PO <em>(lagi proses pengajuan / tanda tangan dokument)</em></p>\n\n<p>7. Alhamdulillah PO</p>\n\n<p>8. Postponed (ditunda ditahun berikutnya)</p>\n\n<p>9. Loss atau&nbsp;Abandon (kalah atau batal)</p>\n\n<p>&nbsp;</p>\n\n<p><u><strong>Cara Mengisi Tahapan (STAGE)</strong></u></p>\n\n<p>- Jika anda mau mencantumkan tahapan 4 di aktivitas maka di catatan hasil harus ada poin&nbsp;diisi dengan budgetnya brapa ?(cukup/tdk), estimasi dieksekusinya kapan ? isi dengan bulan atau tanggal. dan jika dikemudian hari masih mengisi dengan&nbsp;tahapan 4 maka data budget dan estimasi cukup dicantumkan satu kali di awal ngisi tahapan 4.</p>\n\n<p>- Jika sudah&nbsp;tahapan 4 kemudian dilanjutkan naik &nbsp;mengisi&nbsp;tahapan 5 maka dicatatan hasil harus ada poin diisi dengan siapa competitornya..?, dan jika kecenderungan mau milih merk apa&nbsp;sudah diketahui liat cara mengisi&nbsp;<strong>khusus tahapan 5</strong>.</p>\n\n<p>- Jika loncat tahapan misalkan dari tahapan 3 ke 5, maka meskipun tidak berurutan melalui tahapan 4, ketika mengisi tahapan 5 di catatan hasil menuliskan data tahapan 4 dan 5 sekaligus yaitu tentang budget, estimasi eksekusi, kompetitornya.</p>\n\n<p>&nbsp;</p>\n\n<p><u><strong>Percakapan murid dan guru</strong></u></p>\n\n<p><strong>Murid</strong> : guru&nbsp;kalau saya tau kompetitornya dan tau kecenderungan milihnya kemana tapi belum memberikan penawaran, apakah sy bisa mencantumkan stage 5 di laporan.</p>\n\n<p><strong>Guru</strong> : sayangku murid ku&hellip;tidak boleh ya mencantumkan langsung stage 5&hellip;kamu harus lalui tahapan tahapannya dan kalau belum buat penawaran tetep meskipun sdh tau kompetitor dan kecenderungannya hanya boleh mencantumkan STAGE 1 atau 2 tergantung mana yang sdh dilalui tahapannya.</p>\n\n<p><strong>Murid</strong> : oh&nbsp;gitu guru bagimana kalau penawarannya sudah dikirimkan,&nbsp;kompetitor sudah&nbsp;tau dan kecenderungannya juga tau &nbsp;tapi belum tau kapan di eksekusinya apakah bisa cantumin STAGE 5..?</p>\n\n<p><strong>Guru</strong>&nbsp; : sama muridku tidak boleh langsung STAGE 5&hellip; harus lewatin tahap 4 dulu yaitu tau budget dan tau kapan dieksekusinya kalau belum tau berarti maksimal cantumin baru STAGE 3 yaitu baru penawaran.</p>\n\n<p><strong>Murid</strong> : guru kalau saya tau competitor, tau kecenderungannya kemana, tau budget, tau kapan dieksekusi tapi belum membuat penawaran berarti saya kan cantumin STAGE 2, kemudian besoknya saya buat penawaran apakah boleh loncat dari STAGE 2 ke STAGE 5..?</p>\n\n<p><strong>Guru </strong>: Yes&hellip; boleh muridku berarti semua tahapan perolehan data yang diperlukan sudah memenuhi syarat ke STAGE 5, dan ingat ketika cantumin STAGE 5 dicatatan hasil ditulis data data yang diperoleh tadi seperti budget, estimasi eksekusi, kompetitor dan kecenderungannya kemana termasuk presentasenya</p>\n\n<p><strong>Murid</strong> : ok guru faham skrng, tapi sebenernya menurut guru dimana saya harus fokus&nbsp;aktivitasnya..?</p>\n\n<p><strong>Guru</strong>&nbsp; : iya ini tergantung kalau belum punya STAGE 5 berarti harus focus nyari dulu dari mulai STAGE 1 tapi setelah waktu berjalan kamu harus cepat fokus di STAGE 5 keatas&hellip;.krn sesungguhnya STAGE 1-4 hanya pekerjaan administrasi dan pencarian data dasar saja untuk kebutuhan kamu&nbsp;selanjutnya, sedangkan STAGE 5 adalah pekerjaan yang mahal disinilah fungsi sales sesungguhnya karena di STAGE 5 fungsi salesnya utk mempengaruhi bagaimana caranya supaya kecenderungan pelanggan lebih memilih kamu dan produk kamu&hellip;., semakin kamu cepet mempengaruhi pelanggan untuk cenderung memilih kamu&nbsp;disitulah kehebatan seorang sales&hellip;.</p>\n\n<p><strong>Murid</strong> : oh baik guru semakin faham skrng&hellip;. saya kedepan akan&nbsp; dapatkan STAGE 1-4 dalam waktu sesingkat mungkin sebagai bahan data dasar, dan berikutnya akan&nbsp;banyak aktivitas di STAGE 5, supaya banyak berlatih mepengaruhi customer menjadi cenderung memilih ke produk yang MBI ageni.</p>\n\n<p><strong>Murid</strong> : sekali lagi terima kasih guru..</p>\n\n<p><strong>Guru</strong> : iya sama sama muridku mudah2an kamu diberi kekuatan yang lebih untuk menjadi pemenang dan diberi&nbsp;kelancaran dalam menjemput rezeki ya.. dan bermanfaat bagi banyak orang&hellip;</p>\n\n<p><strong>Murid</strong> : Aamiin Ya Alloh</p>\n\n<p>&nbsp;</p>\n', 'divisi', '1', NULL, NULL, 'Aktif', '270611', '2019-05-29 14:25:25', '270611', '2019-07-29 00:00:00');
INSERT INTO `sv_announcements` VALUES (8, 'Pelajaran 2 : Khusus Tahapan 5', '<p><u><strong>Pengertian angka angkanya&nbsp;:</strong></u></p>\n\n<p><strong>5&nbsp;</strong> &nbsp; &nbsp; artinya sudah tahu kompetiotnya tapi belum tau milih ke siapa atau masih milih merk lain</p>\n\n<p><strong>5.25</strong> artinya sudah tahu kompetitornya dan kecenderuangn milih MBI sebesar 25%</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; contoh : customer sudah menyatakan mau milih merk lain tapi masih membuka merk yang diageni MBI</p>\n\n<p><strong>5.50</strong> artinya sdh tahu kompetitornya dan kecenderuangn milih MBI sebesar 50%</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;contoh : customer bisa menerima merk apa saja, dan terlihat kemungkinan bahasanya sama ke kompetitor juga</p>\n\n<p><strong>5.75</strong> artinya sudah tahu kompetitornya dan kecenderuangn milih MBI sebesar 75%</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;contoh : cutomer sudah menyatakan ada kecenderungan milih merk MBI tapi belum ngunci</p>\n\n<p><strong>5.99</strong> artinya sdh tahu kompetitornya dan kecenderuangn milih MBI sebesar 99%</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;contoh : customer sudah menyatakan milih merk yang diageni MBI tidak mau merk lain&nbsp;atau juga bisa dikunci oleh perusahaan global yang mengharuskan merk yang diageni MBI</p>\n', 'divisi', '1', NULL, NULL, 'Aktif', '270611', '2019-06-02 10:41:19', '270611', '2019-07-29 00:00:00');
INSERT INTO `sv_announcements` VALUES (9, 'Pelajaran 3 : Menutup projek Win, Loss, ...', '<p><u><strong>Cara menutup projek yang sedang dikerjakan :</strong></u></p>\n\n<p>1. Jika projek &nbsp;menang (Win) :</p>\n\n<p>-&nbsp; &nbsp; &nbsp;isi dengan jenis aktivitas &quot; 7.1. Alhamdulillah PO &quot;</p>\n\n<p>-&nbsp; &nbsp; &nbsp;isi Tahapan angka 7</p>\n\n<p>2. Jika dalam 1 projek Win&nbsp;dan&nbsp;dibuat dalam 2 pelanggan (user dan suplier) maka buat 2 report aktivitas</p>\n\n<p>-&nbsp; &nbsp; untuk suplier , isi dengan&nbsp;aktivitas &quot; 7.1. Alhamdulillah PO &quot; , lalu isi tahapan dengan angka 7</p>\n\n<p>-&nbsp; &nbsp; untuk customer/end user, ditutu[ dengan isi&nbsp;aktivitas &quot; 7.2. Info PO closing&quot; lalu isi tahapan dengan angka 7</p>\n\n<p>3. Jika projek ditunda (Postponed)&nbsp; : buat dengan jenis aktivitas &quot; 8. Info Postponed &quot;</p>\n\n<p>4. Jika projek kalah (Loss) : buat dengan jenis aktivitas &quot; 9. Info Loss &quot;</p>\n\n<p>5. Jika projek&nbsp;batal (Abandon) : buat dengan jenis aktivitas &quot; 9.1.&nbsp;Info Abandon &quot;</p>\n\n<p>&nbsp;</p>\n\n<p><strong><u>Penjelasan mengisi aktivitas untuk&nbsp;menutup projek di CRM</u></strong></p>\n\n<p><strong>Menang (Win</strong>) : Gunakan jenis aktivitas &quot;Alhamdulillah PO&quot; dan di &quot;Catatan hasil&quot; diisi dengan keterangan yang diperluakan seperti barangnya apa secara garis besarnya,&nbsp;dll.</p>\n\n<p><strong>Kalah (Loss)&nbsp;</strong>: Gunakan jenis aktivitas &quot;Info Loss&quot; dan di &quot;Catatan hasil&quot; diisi dengan keterangan bagaimana kalah dengan menjelaskan&nbsp;siapa kompetitornya yang menang, apakah kalah harga, kalah karena customer ingin merk lain, kalah karena belum kenal MBI atau kecewa dengan MBI dll. Diisi dengan keterangn penyebab kekalahan supaya bisa tahu hal apa yang bisa diperbaiki.</p>\n\n<p><strong>Ditunda (Postponed)</strong>&nbsp;: Gunakan jenis aktivitas &quot;Info Postponed&quot;&nbsp; dan di &quot;Catatan hasil&quot; diisi dengan keterangan bagaimana ditunda dengan menjelaskan alasan pelanggan, apakah budgetnya belum&nbsp;turun, projeknya ditunda, ketidakstabilan keuangan pelanggan dll. (jika ditunda ke lain tahun atau berulang kali cari informasi tapi tidak mendapatkan informasi mengenai tahapan berikutnya)</p>\n\n<p><strong>Batal (Abandon)</strong>&nbsp;:Gunakan jenis aktivitas &quot;Info Abandon&quot; dan di &quot;Catatan hasil&quot; diisi dengan keterangan bagaimana dibatalkan dengan menjelaskan alasan pelanggan, apakah budgetnya tidak jadi turun, projeknya dibatalkan, dll.</p>\n', 'divisi', '1', NULL, NULL, 'Aktif', '270611', '2019-06-02 10:56:32', '39', '2019-09-05 00:00:00');
INSERT INTO `sv_announcements` VALUES (11, 'Normal Kembali...! Harap di bantu', '<p>Dear Team Service</p>\n\n<p>Untuk &nbsp;mendukung menuju MBI 4.0 , management MBI meminta bantuan team service untuk ikut serta aktif dalam mengisi form untuk&nbsp;produk yang dimiliki pelanggan, untuk di isi ke dalam database CRM.</p>\n\n<p>kriteria alat yang di masukkan data nya ke CRM :</p>\n\n<p>-alat analitik kompetitor dari product perkinelmer</p>\n\n<p>-alat WPS kompetitor dari product evoqua</p>\n\n<p>-alat centrifuge kompetitor dari product centurion</p>\n\n<p>Kapan wajib mengisi :</p>\n\n<p>1. Setiap instalasi&nbsp;alat baru, &nbsp;maintenance alat dan&nbsp;service alat, untuk dibantu&nbsp;memasukan data data alat tersebut kedalam database CRM.</p>\n\n<p>2. Ketika Menelepon pelanggan (instal base) ataupun kunjungan ke pelanggan, supaya bisa&nbsp;menanyakan / melihat&nbsp;alat apa saja yang dimiliki pelanggan kemudian masukan alat alat tersebut ke database&nbsp;CRM.</p>\n\n<p><u>Caranya :</u></p>\n\n<p>Dengan klik &quot;Aktivitas --&gt; Tambah Produk Pelanggan&quot;.&nbsp;</p>\n\n<p>Sebelum mengisi produk yakinkan produk tersebut belum diisi oleh rekan yang lain, dicek dengan cara klik &quot; Aktivitas --&gt; Cari Pelanggan&quot; kemudian masukan nama pelanggannya dan klik di tab &quot;Data produk pelanggan&quot;, maka akan terlihat data yang sudah diinput</p>\n\n<p>&nbsp;</p>\n\n<p>Terima kasih atas perhatiannya, karena setiap alat yang dimasukan kedalam database CRM sangat berharga untuk kemudahan analisa pergerakan team service, analisa penjualan konsumable dan penjualan unit dimasa yang akan datang.</p>\n\n<p>&nbsp;</p>\n\n<p>Salam,</p>\n\n<p>Management MBI</p>\n', 'divisi', '2', NULL, NULL, 'Aktif', '270611', '2019-06-04 06:02:19', '39', '2019-08-20 00:00:00');
INSERT INTO `sv_announcements` VALUES (12, 'Need help...', '<p>Dear Admin Team..</p>\n\n<p>Saat ini MBI lagi mengadakan perubahan dalam rangka&nbsp;meningkatkan ketepatan,&nbsp;kecepatan dan kenyamanan&nbsp;&nbsp;pelayanan penjualan &nbsp;maka diperlukan informasi yang tepat, cepat dan akurat, untuk itu data data informasi setiap langkah yang dilakukan oleh team MBI sangat perlu untuk di input kedalam CRM-KKM tepat waktu ke database yang bisa diakses secara bersama (yang bekepentingan)&nbsp;dan realtime.</p>\n\n<p><u>Harapan dengan adanya data data yang tepat waktu di input :</u></p>\n\n<p>1. semua yang berkepentingan tentang informasi bisa akses langsung kedalam database melalui&nbsp;CRM-KKM&nbsp;</p>\n\n<p>2. informasi menjadi actual dan jelas&nbsp;tidak lagi bias karena penyampain yang berantai&nbsp;</p>\n\n<p>3. keputusan keputusan akan tepat, cepat dan akurat karena tidak menunggu lagi cari cari data, ataupun penyimpangan informasi karena penyampaian berantai.</p>\n\n<p><u>Saran supaya kita bersama bisa berkembang ke arah yang lebih baik :</u></p>\n\n<p>1. Hindari kata kata &quot;LUPA&quot; , dengan cara selalu cek&nbsp; berulang setiap sudah menyelesaikan pekerjaan atau setiap harinya.</p>\n\n<p>2. tanamkan dalam fikiran bahwa mengisi informasi&nbsp; atau bekerja dengan baik selain untuk diri sendiri dan juga&nbsp;untuk kebutuhan orang banyak adalah termasuk perbuatan yang baik atau itu termasuk&nbsp;memudahkan urusan diri sendiri dan orang lain.&nbsp;Dari Abu Hurairah ra, Nabi SAW, bersabda: &ldquo;<strong><em>Barang siapa yang melepaskan satu kesusahan seorang mukmin, pasti Allah akan melepaskan darinya satu kesusahan pada hari kiamat. Barang siapa yang menjadikan mudah urusan orang lain, pasti Allah akan memudahkannya di dunia dan di akhirat</em></strong><em>.</em></p>\n\n<p>3. tanamkan dalam fikiran bahwa tidak mengisi informasi dengan baik akan bisa menyusahkan orang lain yang efek panjangnya merugikan banyak orang dan menyusahkan atau merugikan orang lain adalah perbuatan dzolim kepada orang lain.</p>\n\n<p>4. selalu mengingat bahwa &quot; kehormatan admin adalah ketika berbicara dengan data&quot;</p>\n\n<p>&nbsp;</p>\n\n<p>Semoga semua team admin bisa membantu untuk mendukung perubahan ke arah yang lebih baik dan selalu bermanfaat untuk banyak orang.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>salam</p>\n\n<p>Management MBI</p>\n', 'divisi', '13', NULL, NULL, 'NonAktif', '270611', '2019-06-16 07:13:01', '270611', '2019-06-30 00:00:00');
INSERT INTO `sv_announcements` VALUES (13, 'Normal Kembali...! Harap di bantu', '<p>Dear Team&nbsp;</p>\n\n<p>Fungsi &quot;Tambah Produk Pelanggan&quot; sudah normal kembali , harap diisi lagi..</p>\n\n<p>Untuk &nbsp;mendukung menuju MBI 4.0 , management MBI meminta bantuan team untuk ikut serta aktif dalam mengisi form untuk&nbsp;produk yang dimiliki pelanggan, untuk di isi ke dalam database CRM.</p>\n\n<p><u>kriteria alat yang di masukkan data nya ke CRM :</u></p>\n\n<p>-alat analitik kompetitor dari product perkinelmer</p>\n\n<p>-alat WPS kompetitor dari product evoqua</p>\n\n<p>-alat centrifuge kompetitor dari product centurion</p>\n\n<p><u>Kapan wajib mengisi :</u></p>\n\n<p>Ketika Menelepon pelanggan (instal base) ataupun kunjungan ke pelanggan, supaya bisa&nbsp;menanyakan / melihat&nbsp;alat apa saja yang dimiliki pelanggan kemudian masukan alat alat tersebut ke database&nbsp;CRM.</p>\n\n<p><u>Caranya :</u></p>\n\n<p>Dengan klik &quot;Aktivitas --&gt; Tambah Produk Pelanggan&quot;.&nbsp;</p>\n\n<p>Sebelum mengisi produk yakinkan produk tersebut belum diisi oleh rekan yang lain, dicek dengan cara klik &quot; Aktivitas --&gt; Cari Pelanggan&quot; kemudian masukan nama pelanggannya dan klik di tab &quot;Data produk pelanggan.</p>\n\n<p>&nbsp;</p>\n\n<p>Terima kasih atas perhatiannya, karena setiap alat yang dimasukan kedalam database CRM sangat berharga untuk kemudahan analisa penjualan dan penjualan dimasa yang akan datang.</p>\n\n<p>&nbsp;</p>\n\n<p>Salam,</p>\n\n<p>Management MBI</p>\n', 'divisi', '1', NULL, NULL, 'NonAktif', '270611', '2019-07-01 13:03:38', '270611', '2019-07-02 00:00:00');
INSERT INTO `sv_announcements` VALUES (14, 'Forecast...!  sudah aktif', '<p>Dear Team</p>\n\n<p>&nbsp;</p>\n\n<p>Menu Forcast sudah Aktif dan untuk membukanya silahkan klik</p>\n\n<p>Aktivitas &mdash;&gt; Forecast</p>\n\n<p>jika belum muncul menu Forecast silahkan menghubungi P Ari utk diaktifkan&hellip;</p>\n\n<p>&nbsp;</p>\n\n<p><u>Penjelasan :</u></p>\n\n<p>Gunakan menu ini untuk memantau forcast anda secara realtime dan rutin, serta untuk&nbsp; menghasilkan ketepatan data forecast anda pastikan mengisi Aktivitas sesuai pelajaran 1-3 mengenai Tahapan Penjualan (stage).</p>\n\n<p>Jika dalam forecast anda ada customer yang masuk padahal customer tersebut sudah PO untuk membenahinya fahami Pelajaran 3 &nbsp;Menutup Projek.</p>\n\n<p>Dan isi Estimasi (sales) &nbsp;di &quot;input aktivitas &quot; untuk melewati tahapan 4 (utk data forecast)</p>\n\n<p>&nbsp;</p>\n\n<p>Demikian info terbaru, jika kurang jelas silahkan hub leadernya masing masing</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Salam</p>\n\n<p>Management MBI</p>\n', 'divisi', '1', NULL, NULL, 'NonAktif', '31', '2019-07-05 07:52:51', '270611', '2019-07-08 00:00:00');
INSERT INTO `sv_announcements` VALUES (15, 'Kirim Prospek, Terima Prospek sudah Aktif...', '<p>Dear Team</p>\n\n<p>Ada fasilitas baru&nbsp; di CRM sudah diaktifkan untuk bisa &ldquo;Kirim Prospek&rdquo; dan &ldquo;Terima Prospek&rdquo; dengan sesama rekan kita</p>\n\n<p>Caranya :</p>\n\n<p>1. Untuk mengirimkan prospek ke rekan anda, klik di menu Aktivitas &mdash;&gt; Kirim Prospek, kemudian klik &ldquo;Add&rdquo; lalu isi kepada siapa anda inginkan prospek itu dikirim, dan setelah buat kirim prospek maka anda akan melihat kumpulan prospek yang dikirim kerekan anda dan akan lihat di kolom &ldquo;Follow up&rdquo; kapan teman anda follow up prospek yang anda kirimkan.</p>\n\n<p>2. Untuk melihat menerima prospek dari rekan anda , klik di menu Aktivitas &mdash;&gt; Terima Prospek , jika sdh ada di tabel terima prospek lihat kolom &ldquo; Follow up&rdquo;, dan jika anda sudah mem-follow up prospek yang dikirim dari rekan anda silahkan klik di kolom &ldquo;Follow up&rdquo; menandakan anda sudah melakukan follow up dan rekan anda yang mengirimkan akan tahu bahwa anda sudah follow up.</p>\n\n<p>&nbsp;</p>\n\n<p>Gunanya :</p>\n\n<p>1. anda dan rekan anda bisa saling kirim prospek sesuai dengan pekerjaan anda masing masing</p>\n\n<p>2. bisa melihat / mengukur berapa lama anda mem-follow up prospek yang di kirim oleh rekan anda.</p>\n\n<p>3. anda bisa mengirim dimana saja sehingga waktu anda lebih hemat dan informasi cepat sampai.</p>\n\n<p>4. anda juga bisa menerima prospek dimana saja dengan cepat.</p>\n\n<p>5. prospek yang dikirim dan diterima akan tercatat dengan baik mempunyai history yang bisa dirunut nantinya.</p>\n\n<p>6. bisa digunakan dari seles ke sales, dari service ke sales, dari sales ke servis, dari sales ke admin, dari admin ke sales atau servis, dari servis ke admin.</p>\n\n<p>7. bisa untuk dijadikan penilaian proses&nbsp; penjualan dan service anda</p>\n\n<p>&nbsp;</p>\n\n<p>Pertolongan :</p>\n\n<p>Jika kesulitan atau di CRM anda fasilitas &ldquo;Kirim Prospek&rdquo; dan &ldquo;Terima Prospek&rdquo;&nbsp; belum muncul silahkan hubungi kami p Ari atau ibu Feby</p>\n\n<p>&nbsp;</p>\n\n<p>Semoga perubahan kita di MBI dengan tambah tools teknologi 4.0 akan jadi lebih sederhana, cepat dan akurat.</p>\n\n<p>&nbsp;</p>\n\n<p>Terima kasih</p>\n\n<p>Management MBI</p>\n', 'divisi', '1', NULL, NULL, 'NonAktif', '270611', '2019-07-18 07:23:41', '270611', '2019-07-29 00:00:00');
INSERT INTO `sv_announcements` VALUES (16, 'Kirim Prospek, Terima Prospek sudah aktif....', '<p>Dear Team</p>\n\n<p>Ada fasilitas baru&nbsp; di CRM sudah diaktifkan untuk bisa &ldquo;Kirim Prospek&rdquo; dan &ldquo;Terima Prospek&rdquo; dengan sesama rekan kita</p>\n\n<p>Caranya :</p>\n\n<p>1. Untuk mengirimkan prospek ke rekan anda, klik di menu Aktivitas &mdash;&gt; Kirim Prospek, kemudian klik &ldquo;Add&rdquo; lalu isi kepada siapa anda inginkan prospek itu dikirim, dan setelah buat kirim prospek maka anda akan melihat kumpulan prospek yang dikirim kerekan anda dan akan lihat di kolom &ldquo;Follow up&rdquo; kapan teman anda follow up prospek yang anda kirimkan.</p>\n\n<p>2. Untuk melihat menerima prospek dari rekan anda , klik di menu Aktivitas &mdash;&gt; Terima Prospek , jika sdh ada di tabel terima prospek lihat kolom &ldquo; Follow up&rdquo;, dan jika anda sudah mem-follow up prospek yang dikirim dari rekan anda silahkan klik di kolom &ldquo;Follow up&rdquo; menandakan anda sudah melakukan follow up dan rekan anda yang mengirimkan akan tahu bahwa anda sudah follow up.</p>\n\n<p>&nbsp;</p>\n\n<p>Gunanya :</p>\n\n<p>1. anda dan rekan anda bisa saling kirim prospek sesuai dengan pekerjaan anda masing masing</p>\n\n<p>2. bisa melihat / mengukur berapa lama anda mem-follow up prospek yang di kirim oleh rekan anda.</p>\n\n<p>3. anda bisa mengirim dimana saja sehingga waktu anda lebih hemat dan informasi cepat sampai.</p>\n\n<p>4. anda juga bisa menerima prospek dimana saja dengan cepat.</p>\n\n<p>5. prospek yang dikirim dan diterima akan tercatat dengan baik mempunyai history yang bisa dirunut nantinya.</p>\n\n<p>6. bisa digunakan dari seles ke sales, dari service ke sales, dari sales ke servis, dari sales ke admin, dari admin ke sales atau servis, dari servis ke admin.</p>\n\n<p>7. bisa untuk dijadikan penilaian proses&nbsp; penjualan dan service anda</p>\n\n<p>&nbsp;</p>\n\n<p>Pertolongan :</p>\n\n<p>Jika kesulitan atau di CRM anda fasilitas &ldquo;Kirim Prospek&rdquo; dan &ldquo;Terima Prospek&rdquo;&nbsp; belum muncul silahkan hubungi kami p Ari atau ibu Feby</p>\n\n<p>&nbsp;</p>\n\n<p>Semoga perubahan kita di MBI dengan tambah tools teknologi 4.0 akan jadi lebih sederhana, cepat dan akurat.</p>\n\n<p>&nbsp;</p>\n\n<p>Terima kasih</p>\n\n<p>Management MBI</p>\n', 'divisi', '2', NULL, NULL, 'Aktif', '270611', '2019-07-18 07:35:40', NULL, NULL);
