INSERT INTO `sv_master_letter` VALUES (1, 'LT01                ', 'Pengambilan DO Tanpa Original BL', 'ADMIN     ', 'KEPADA YTH :', 'Perihal : PENGAMBILAN D/O TANPA ORIGINAL B/L', 'Dengan hormat,\r\n\r\nDengan ini kami menyatakan bahwa sesuai dengan pemberitahuan dari Agent kami', 'bahwa original B/L telah di surrendered di port of loading dengan data-data sbb :', 'Oleh karena itu mohon pada Bapak/Ibu agar dapat menyerahkan D/O atas barang Import dimaksud tanpa menyerahkan BL Asli dan segala biaya yang timbul atas penyerahan D/O ini menjadi tanggung jawab consignee', 'Demikianlah surat pengantar ini kami buat, atas perhatian dan kerjasama yan baik kami ucapkan terima kasih.\r\n\r\nHormat kami,\r\n\r\n\r\n\r\n(DELWATY BSc.)\r\n-----------------------\r\nImport Marketing Manager', 1, 'SA        ', 'SA        ', '2008-11-13 15:32:00', '0000-00-00 00:00:00');
INSERT INTO `sv_master_letter` VALUES (2, 'LT02                ', 'Surat Pernyataa', 'ADMIN     ', 'Kami P.T. JATIDIRI TRANS selaku agent dari', 'dengan ini menerangkan bahwa shipment berikut dibawah ini :', 'Sesuai data pada house BL dan Packing List / Invoice, dengan ini menyatakan bahwa shipment diatas adalah milik dari :', 'Demikian keterangan ini disampaikan untuk digunakan seperlunya.\r\nsegala resiko dan tanggung jawab atas surat pernyataan ini menjadi beban dari', 'dan P.T. JATIDIRI TRANS', 'Hormat kami,\r\nP.T. JATIDIRI TRANS\r\n\r\n\r\n\r\n\r\n(DELWATY BSc.)\r\n----------------------------------\r\nImport Marketing Manager', 1, 'SA        ', 'SA        ', '2008-08-25 11:02:00', '0000-00-00 00:00:00');
INSERT INTO `sv_master_letter` VALUES (3, 'LT03                ', 'Surat Kuasa', 'ADMIN     ', 'KEPADA YTH :', 'Perihal : SURAT KUASA', 'Dengan hormat,\r\n\r\nDengan ini kami sampaikan penunjukan / pengalihan tanggung jawab kepada ACTUAL CNEE / IMPORTIR atas barang dengan data sbb :', 'Oleh karena itu biaya yang timbul (Biaya destination, Demurrage, Repair Container, Cleaning Container, dll).\r\nDibebankan kepada Actual Cnee/Importir', 'Demikianlah surat ini kami sampaikan, atas perhatian dan kerjasamanya kami ucapkan terima kasih.', 'Hormat kami,\r\nPT. JATIDIRI TRANS\r\n\r\n\r\n\r\n(DELWATY BSc.)\r\n--------------------------------\r\nImport Marketing Manager', 1, 'SA        ', 'SA        ', '2008-11-12 12:43:00', '0000-00-00 00:00:00');
INSERT INTO `sv_master_letter` VALUES (4, 'LT04                ', 'Surat Pengalihan Tanggung Jawab', 'ADMIN     ', 'KEPADA YTH :', 'Perihal : SURAT PENGALIHAN TANGGUNG JAWAB', 'Dengan hormat,\r\n\r\nDengan ini kami sampaikan surat penunjukan / pengalihan tanggung jawab kepada ACTUAL CNEE / IMPORTIR atas nama barang dengan data sbb :', 'Oleh karena itu biaya yang timbul (biaya destination, demmurage, repair container, cleaning container, etc) dibebankan kepada ACTUAL CNEE / IMPORTIR.\r\nDemikianlah surat ini kami sampaikan, atas perhatian dan kerjasamanya kami ucapkan terima kasih.', 'Hormat kami,\r\n\r\n\r\n\r\n(DELWATY BSc.)\r\n-------------------------------\r\nImport Marketing Manager', '', 1, 'SA        ', 'SA        ', '2008-08-25 11:19:00', '0000-00-00 00:00:00');
INSERT INTO `sv_master_letter` VALUES (5, 'LT05                ', 'Application Form Car Release To In Bound', 'ADMIN     ', 'APPLICATION FORM CAR RELEASE TO IN BOUND', 'DEAR SIR,', 'WE (PT. JATIDIRI TRANS), CONFIRM HEREBY THAT WE ARE THE RIGHTFULL OWNER OF THE ABOVE MENTIONED SHIPMENT AND ALSO THE PARTY DESIGNATED BY THE SHIPPING AS THE RECEIVER OF THE ODS AS PER THE APPLICATION FORM OF THE TELEX RELEASE FOR WHICH THE SHIPPERS SURRENDER ORIGINAL BILL OF LADING.', 'WE ACCEPT FULL RESPONSIBILITY AND FURTHER HOLD YOUR HARMLESS FROM ALL CONSEQUENCES FOR SUCH RELEASE OF THE CONTAINER(S)/CAR IN THIS MANNER, WITH NO ABILITY TO', 'SHIPPING YOUR PRINCIPAL AGENTS.', 'DELAWATY BSc\r\nImport Marketing Manager', 1, 'SA        ', 'SA        ', '2008-08-25 11:03:00', '0000-00-00 00:00:00');
INSERT INTO `sv_master_letter` VALUES (6, 'LT06                ', 'Pengambilan DO Tanpa Original BL CoLoader', 'ADMIN     ', 'KEPADA YTH :', 'Perihal : PENGAMBILAN D/O TANPA ORIGINAL B/L', 'Dengan hormat,\r\n\r\nDengan ini kami menyatakan bahwa sesuai dengan pemberitahuan dari Agent kami', 'bahwa original B/L telah di surrendered di port of loading dengan data-data sbb :', 'Oleh karena itu mohon pada Bapak/Ibu agar dapat menyerahkan D/O atas barang Import dimaksud tanpa menyerahkan BL Asli dan segala biaya yang timbul atas penyerahan D/O ini menjadi tanggung jawab consignee kami.', 'Demikianlah surat pengantar ini kami buat, atas perhatian dan kerjasama yan baik kami ucapkan terima kasih.\r\n\r\nHormat kami,\r\n\r\n\r\n\r\n(DELWATY BSc.)\r\n-----------------------\r\nImport Marketing Manager', 1, 'SA        ', 'SA        ', '2008-12-02 15:01:00', '0000-00-00 00:00:00');
INSERT INTO `sv_master_letter` VALUES (7, 'LT07                ', 'Permohonan Release DO Tanpa Original BL', 'ADMIN     ', 'KEPADA YTH :', 'Perihal : PENGAMBILAN D/O TANPA ORIGINAL B/L', 'Dengan hormat,', 'bahwa original B/L telah di surrendered di port of loading dengan data-data sbb :', 'Oleh karena itu mohon pada Bapak/Ibu agar dapat menyerahkan D/O atas barang Import dimaksud tanpa menyerahkan BL Asli dan segala biaya yang timbul atas penyerahan D/O ini menjadi tanggung jawab consignee kami.', 'Demikianlah surat pengantar ini kami buat, atas perhatian dan kerjasama yan baik kami ucapkan terima kasih.', 1, '          ', '          ', '2012-02-15 09:03:00', '0000-00-00 00:00:00');
